import { createTheme } from '@mui/material';
import { palette } from '@mui/system';


const theme = createTheme({
    palette: {
        primary: {
            main: '#858484'
        },
        secondary: {
            main: '#FF7700'
        },
        text: {
            primary: "rgb(0,0,0)",
            secondary: "rgb(255,255,255)",
        }
    },}
)

export default theme;
